import axios from "axios";
import {useState, useEffect } from 'react'

function App() {
  const [data, setData] = useState(null);

  useEffect(()=>{
    axios.get('/')
    .then((res) =>{
      console.log(res);
      setData(res)
    })
  })

  return (
    data == null ? (
      <div className="App">
      </div>
    ) : (
      <div className="App">

    </div>
    )
  );
}

export default App;
